import React from 'react';

const Navbar = () =>{
    return(
    <div>
        <nav className="navbar navbar-dark indigo">
        <span className="navbar-text white-text">
            Navbar text with an inline element
        </span>
        </nav>
    </div>
    )
}
export default Navbar;
